import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import About from './Components/About/About'

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/" component={About} />
          <Route path="/projects" component={Projects} />
        </Switch>
      </Router>
    </div>
  );
}

export default App
